import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Body from "./Body";

function Root(){

    return (
        <div>
            <Header class="header"/>
            <Body class="body"/>
            <Footer class="footer"/>
        </div>
    ) 
}

export default Root;
